De softbalafdeling is geenszins bereid om volgend jaar zonder 2e team te spelen. Er zal echter eerst bekeken moeten worden wie er blijven spelen, wie er weg gaan, wie er bijkomen etc. etc. Alles wat je op dit moment nog hoort over teams, coaches etc. zijn ongegronde speculaties en ouderwetse roddels en in veel gevallen gaat niet eens het "waar rook is, is vuur"-principe op. Wat je wel kunt stellen is dat we momenteel en eigenlijk het hele seizoen al weinig spelende softballeden hebben in verhouding met een aantal jaren terug en dat daar best wel wat bij zouden kunnen! Wellicht zou je de Softbalafdeling kunnen ondersteunen in een wervingscampagne!? Je kunt je bij mij aanmelden.','Juul','jvosselman@hotmail.com',null,null,'1',to_date('15-09-04','DD-MM-RR'));

