Britten honkbalden met levende kalkoenen

LONDEN (ANP) - Twee Britse mannen zijn veroordeeld tot 200 uur taakstraf omdat zij een potje honkbal hadden gespeeld met levende kalkoenen. Getuigen spraken voor de rechtbank in Norwich van ,,de gruwelijkste daden van wreedheid tegen dieren''''. Dat berichtte het dagblad The Times vrijdag.

Het tweetal werkte via een uitzendbureau op een kalkoenenboerderij. Ze waren daar ingehuurd om vogels te vangen voor de slacht. De stok die ze daarvoor van hun baas hadden gekregen, gebruikten zij echter als honkbalknuppel. Hun ''spel'' werd in april in het geheim gefilmd.

Volgens hun advocaat handelden de mannen onder druk van hun werkgever. Een woordvoerder van het pluimveebedrijf liet echter weten dat zij kort na het incident zijn ontslagen. ,,Wij verwelkomen de beslissing van de rechtbank. Het welzijn van onze vogels staat bij ons voorop'''', aldus de zegsman.








