Alles zat mee; 
- geweldig weer,
- spelen op het hoofdveld (is wat extra werk, maar met Richard als veldexpert is het allemaal gelukt),
- live verslag door Esther als speaker en muziek tussen de inningen door, 
- prima scheidsrechterskoppel Suus en Willeke,
- super tegenstanders de Panters uit Tiel, zetten ons flink onder druk, waardoor het een echte  kampioenswedstrijd werd en hadden na afloop voor iedere aspirant een persoonlijk presentje, 
- heel heel veel enthousiast publiek dat ons naar het kampioenschap heeft geschreeuwd,  
- bloemen, een beker, een speech en taart van de voorzitter Hans, 
- unieke kampioens-T-shirts voor elke speelster en de coaches, een cadeau van 3 vaders; Olaf, Rob en Erik,
- scoring en perfect getimede begeleiding van de coaches in de dugout door Bea, 
- goede regie door Annet en 
- na afloop een heerlijk BBQ voor speelsters en ouders samen met de andere kampioenen honkbal junioren 1, geregeld door Rob.
