Auburn attempted to make a comeback in the top of the 7th however their bid at the comeback ended one run short as they were only able to score two runs to cut the lead to 7-6. With a runner on third base and one out Cutters relief pitcher Mike Bolsenbroek (0-0, 1.93) struck out Brisker and induced pinch hitter Lance Durham into an inning ending ground out to first baseman Stephen Batts. 
Bolsenbroek finished the last two inning in picking up his first save in a Williamsport Crosscutters uniform. 
Cutters starting pitcher Joshua Zeid picked up his 8th win of the season, allowing four runs on eight hits while striking out eight Doubledays. 
Jiwan James was an impressive 4 for 5 in his final game of the 2009 season. Castro finished 1 for 3 with his grand slam and 5 RBIs and Anthony Hewitt went out on a solid note, going 2 for 4 with a double and triple. 
The Crosscutters finished the 2009 season with an overall record of 42-34, their most wins since 2005. 
