Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('986','Hee Juul,spelers van buitenaf zijn meestal (!) geen blijvers (lees; voor de lange termijn)dus ik ben van mening dat we als club, nu we in de 2e klasse uitkomen, moeten gaan bouwen met "eigen" spelers aan een hoger niveau. Ik denk nm. dat met de spelers van buitenaf we tzt weer met dezelfde problemen te maken krijgen als afgelopen seizoen. Te weinig kwaliteit om mee te kunnen doen op het 1e klasse niveau! onze jongens zullen denk ik in een groep van buitenaf die van één club komen (Giants)te weing speeltijd en dus ervaring krijgen zeker nu we maar één competitie-wedstrijd in het weekend spelen. Of dhr Jahn er net zo over denkt durf ik stellig te betwijfelen!! ','Bryan',null,null,null,'1',to_date('18-10-04','DD-MM-RR'));
Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('987','Gelukkig zijn er ook uitzonderingen die later heel waardevol voor de club blijken, denk aan Hans Kunnen, Hans van Veghcel en zo zijn er nog een aantal. Ook zij zijn ooit van een andere club gekomen. Ik begrijp je standpunt en je bezorgdheid hierover wel hoor en ik wil er best verder met je over babbelen, moet je me maar even mailen. Voor de duidelijkheid als er beslissingen als deze genomen worden dan gebeurt dit altijd met goedkeuring van bestuur en honkbalcommissie. Mail maar. ','Juul','jvosselman@hotmail.com',null,null,'1',to_date('18-10-04','DD-MM-RR'));
