Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('1166','Ontving info over jullie homepage. Ziet er geweldig uit! Ben slechts nog een toeschouwer van honkbal. In de jaren zeventig echter actief bij Robur (gepokt en gemazeld door de heren Jahn). Sukses met de competitie en de club. Groet, Erik Orie','Erik Orie','erik.orie@vopak.com',null,null,'1',to_date('12-07-05','DD-MM-RR'));
Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('1167','Ik wil iedereen die heeft bijgedragen aan het succes van de serie 2005 heel hartelijk bedanken voor hun inzet en enthousiasme. Het waren mijn 1e series en ik hoop niet de laatste. Ik heb enorm genoten en ik vond het spelniveau erg goed. Bedankt iedereen.
Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('1168','  To yhe Robur 58 Tournment committee, I would like to extend a huge thank you for allowing the USA Athletes to be apart of this experience. I enjoyed myself with playing and being able to tour this amazing country. Thank you for the life time experience.  ','Amy Harrison','alh03h@garnet.fsu.edu',null,null,'1',to_date('13-07-05','DD-MM-RR'));
Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('1169','This trip to Holland was amazing. I had a great time playing softball in the Robur ''58 tournament. I have established life-long friendships with my teammates, and loved playing this game on an international level.I would like to thank the tournament committee for all of the hard work with the rain, and for the welcoming hospitality. Thank you for the memories.','Sunny Oelling','sunnyd-sign@excite.com',null,null,'1',to_date('13-07-05','DD-MM-RR'));
