Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('1424','&gt;&gt;&gt;OPROEP&lt;&lt;&lt; aan alle jeugdspelers en -speelsters: we hebben jullie nodig! de jeugdmanifestatie SHAKE is er weer, a.s. donderdag 24 augustus van 15-21 uur op de Markt. Sport, plezier en informatie door elkaar heen. Help Robur''58 aan nieuwe jeugdspelers/sters! Kom het liefst in je uniform; durf jij je leeftijdsgenootjes uit te leggen hoe je gooit of slaat? Help ons mee met de snelheidsmeter en de slagkooi. Kom donderdagmiddag gewoon langs of - als je nog vragen hebt - mail mij even met je telefoonnummer: kunnen@bart.nl. ','Hans Kunnen',null,null,null,'1',to_date('22-08-06','DD-MM-RR'));
Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('1425','Komt allen zaterdag 2 september kijken naar de strijd om het kampioensschap tussen Robbers Robur Softbal 1 en Zuidvogels. Aanvang 14.00 uur','Jeoren Vaessen',null,null,null,'1',to_date('28-08-06','DD-MM-RR'));
Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('1426','Voor het eerst in mn leven een honkbalwedstrijd live mogen aanschouwen afgelopen zaterdag van mijn grote vriend Declan.Gezellie met Jeannette en Co het team aangemoedigd maar helaas verloren. Jammer dat de wedstrijd gestaakt werd want heel graag had ik Dec even willen zien als pitcher. Weet zeker dat hij hierin een toppertje wordt. Co, dank voor de gezelligheid en het warm houden van onze billen en Netteke, allerliefste vriendin,ik vond het heel gezellig met je hoor en heb me totaal nergens aan gestoord. Was alleen maar leuk en lachen. Hoop snel weer een keertje mee te mogen want naturlijk wil ik Martin ook een keer zien coachen.','Astrid',null,null,null,'1',to_date('29-08-06','DD-MM-RR'));
