Insert into BSM_OWNER.GASTENBOEK (VOLGNR,OPMERKING,NAAM,EMAIL,HOMEPAGENAAM,HOMEPAGE,TYPE_GASTENBOEK,DATUM) values ('1559','Als honkbalfan volg ik op allerlei manieren de verrichtingen van de clubs in "het oosten". Ik denk nog vaak met weemoed terug aan de tijd van Rayon Het Oosten. Het presteren van Robur 1 (honkbal) heb ik nauwlettend gevolgd en ook ik ben - net zoals zoveel anderen - van mening dat het niet zo mag zijn, dat torenhoge eisen vanuit de KNBSB alleen al het spelen van promotiewedstrijden, in de weg staan. Robur zou op zijn minst de kans moeten hebben om aan te tonen of het team sportief gezien in staat zou zijn de stap naar de hoofdklasse te maken. Hoe e.e.a. verder zou moeten m.b.t. het spelen in de hoofdklasse weet ik ook zo niet, maar een brede discussie over dit onderwerp zou op zijn minst gevoerd moeten worden. Oh ja, voordat ik het vergeet: alsnog gefeliciteerd met jullie gewelidge kampioenschap. Ik denk ook, dat ik dat mag doen namens vele leden van Blue Devils.','nanno groenink','nannogroenink@xs4all.nl',null,null,'1',to_date('14-09-07','DD-MM-RR'));
